      <FormGroup>
        <Label for="message">Message:</Label>
        <Input
        type="textarea"
        name="message"
        onChange={this.handleChange} />
      </FormGroup>

      <Button>Submit</Button>
    </Form>
    // </div>
  );
};

export default Approach;
